import react from "react";

function Websites(){
    return(
        <div>
            <h1> Websites </h1>
            <a href="https://www.w3schools.com"> W3 Schools </a>
            <a href="https://www.geeksforgeeks.org"> Geeks for Geeks </a>
            <a href="https://replit.com"> Replit </a>
            <a href="https://www.codewars.com"> Codewars </a>
        </div>
    );

}
